import React, { useState, useEffect } from 'react';
import './Reviews.css';

const Reviews = () => {
  const [reviews, setReviews] = useState([]);
  const [loading, setLoading] = useState(true);

  // Mock reviews data (in a real app, this would come from Google Places API)
  const mockReviews = [
    {
      id: 1,
      author: 'RedMythos',
      date: '2023-12-24',
      rating: 5,
      text: 'Ik heb mijn Ferrari bij Premium Car Detailing laten keramisch coaten, super tevreden! Goede kwaliteit en veel vakkennis in huis, gaf direct...',
      fullText: 'Ik heb mijn Ferrari bij Premium Car Detailing laten keramisch coaten, super tevreden! Goede kwaliteit en veel vakkennis in huis, gaf direct een professionele indruk. Het resultaat is fantastisch en de auto ziet er weer als nieuw uit.',
      avatar: 'R'
    },
    {
      id: 2,
      author: 'Maurice D',
      date: '2023-09-26',
      rating: 5,
      text: 'Denkt mee met de klant en geeft daar waar nodig extra advies. Oog voor detail. Prima service en eind resultaat w...',
      fullText: 'Denkt mee met de klant en geeft daar waar nodig extra advies. Oog voor detail. Prima service en eind resultaat was geweldig. Zeer aan te bevelen!',
      avatar: 'M'
    },
    {
      id: 3,
      author: 'Leroy Rooding',
      date: '2023-09-01',
      rating: 5,
      text: 'Ik heb meerdere malen van de services van Premium Car Detailing gebruik gemaakt. En ben iedere keer opnieuw positief verrast over...',
      fullText: 'Ik heb meerdere malen van de services van Premium Car Detailing gebruik gemaakt. En ben iedere keer opnieuw positief verrast over de kwaliteit en service. Echt een aanrader!',
      avatar: 'L'
    },
    {
      id: 4,
      author: 'Christiaan Bulles',
      date: '2023-09-01',
      rating: 5,
      text: 'Vanaf het moment dat ik mijn voertuig hier binnenbracht, wist ik dat ik kon rekenen op eersteklas service en vakmanschap....',
      fullText: 'Vanaf het moment dat ik mijn voertuig hier binnenbracht, wist ik dat ik kon rekenen op eersteklas service en vakmanschap. Zeer professioneel en betrouwbaar.',
      avatar: 'C'
    },
    {
      id: 5,
      author: 'Dwayne Westering',
      date: '2023-08-26',
      rating: 5,
      text: 'Prachtig resultaat. Eerlijke prijs voor de beste kwaliteit.',
      fullText: 'Prachtig resultaat. Eerlijke prijs voor de beste kwaliteit. Zeer tevreden met de service en het eindresultaat.',
      avatar: 'D'
    }
  ];

  useEffect(() => {
    // Simulate API call
    setTimeout(() => {
      setReviews(mockReviews);
      setLoading(false);
    }, 1000);
  }, []);

  const formatDate = (dateString) => {
    const date = new Date(dateString);
    return date.toLocaleDateString('nl-NL', {
      year: 'numeric',
      month: '2-digit',
      day: '2-digit'
    });
  };

  const renderStars = (rating) => {
    return Array.from({ length: 5 }, (_, index) => (
      <span key={index} className={`star ${index < rating ? 'filled' : ''}`}>
        â˜…
      </span>
    ));
  };

  if (loading) {
    return (
      <section className="reviews">
        <div className="container">
          <div className="reviews-header">
            <p className="reviews-subtitle">-- REVIEWS --</p>
            <h2 className="reviews-title">
              UW FEEDBACK IS ONZE STUWKRACHT, LEES EN DEEL UW ERVARINGEN!
            </h2>
          </div>
          <div className="reviews-loading">
            <div className="loading-spinner"></div>
            <p>Reviews laden...</p>
          </div>
        </div>
      </section>
    );
  }

  return (
    <section className="reviews">
      <div className="container">
        <div className="reviews-header">
          <p className="reviews-subtitle">-- REVIEWS --</p>
          <h2 className="reviews-title">
            UW FEEDBACK IS ONZE STUWKRACHT, LEES EN DEEL UW ERVARINGEN!
          </h2>
        </div>

        <div className="reviews-grid">
          {reviews.map((review) => (
            <div key={review.id} className="review-card">
              <div className="review-header">
                <div className="review-avatar">
                  <span>{review.avatar}</span>
                </div>
                <div className="review-info">
                  <div className="review-author">
                    <span className="author-name">{review.author}</span>
                    <span className="google-icon">G</span>
                  </div>
                  <div className="review-date">{formatDate(review.date)}</div>
                </div>
              </div>
              
              <div className="review-rating">
                {renderStars(review.rating)}
              </div>
              
              <div className="review-text">
                <p>{review.text}</p>
                <button className="read-more-btn">Lees verder</button>
              </div>
            </div>
          ))}
        </div>

        <div className="reviews-summary">
          <p>Google waardering: 5.0 van 5, gebaseerd op 10 recensies</p>
        </div>
      </div>
    </section>
  );
};

export default Reviews;
